  const [coins, setCoins] = useState([])


  useEffect(()=>{
    axios.get('https://api.coingecko.com/ap/v3/coins/markets?vs_currency=czk&order=market_cap_desc&per_page=100&page=1&sparkline=false')
    .then(res =>{
      setCoins(res.data)
    }).catch(err=>{
      console.log(err)
      alert('Error')
    })
  })




